import React, {useState, useEffect} from "react";
import { Container, Form, Button } from "react-bootstrap";
import axios from "axios";

const Contact = () => {

    const [contact, setContact] = useState({
    name: "",
    phone: "",
    email: "",
    region: "",
    comments: "",
    
  });

  const [msg, setMsg] = useState("");

  const handleChange = (e) => {
    setContact({ ...contact, [e.target.name]: e.target.value });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    await axios
      .post("http://localhost:5000/addContact/", contact)
      .then((res) => console.log("200 Added contact"))
      .catch((err) => console.log("Error " + err));
  };

    return(
        <Container style={{marginTop: "20px"}} className="border rounded p-3 mb-3">
            <h5>Didn't find the right package for your perfect holiday? Are you looking for a more personalized experience? Don't worry, we've got you covered!</h5>
            <h6>Please leave us an email address as well as a short description of what you are looking for and we'll make sure to contact you in no time!</h6>
            {/*Form starts here*/}
            <Form style={{marginTop: "10px"}} onSubmit={handleSubmit}>
            <Form.Group className="mb-3" controlId="exampleForm.ControlName1">
            <Form.Label>Name and Surname</Form.Label>
            <Form.Control type="text" placeholder="Jon Smith" value={contact.name}  name="name" onChange={handleChange} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="exampleForm.ControlNumber1">
            <Form.Label>Phone number</Form.Label>
            <Form.Control type="text" placeholder="(+355) 686044497" value={contact.phone} name="phone" onChange={handleChange} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="name@example.com" value={contact.email} name="email" onChange={handleChange} />
            </Form.Group>
            {/* Select starts here*/}
            <Form.Label>Please select your target region</Form.Label>
            <Form.Group className="mb-3" >
            <Form.Select aria-label="Default select example" value={contact.region} name="region" onChange={handleChange} >
           <option>Open this select menu</option>
           <option value="1">Albania</option>
           <option value="2">Europe</option>
           <option value="3">Middle East</option>
           <option value="4">Far East</option>
           </Form.Select>
           </Form.Group>
            {/* Select ends here*/}
            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
            <Form.Label>Comments</Form.Label>
            <Form.Control as="textarea" rows={3} value={contact.comments} name="comments" onChange={handleChange} />
            </Form.Group>
            <Form.Group className="mb-3">
            <Button variant="primary" type="submit">Submit
            </Button>
            </Form.Group>
            </Form>
            <p>{}</p>
            {/*Form ends here*/}
        </Container>
    )
}

export default Contact;
